offers.description:
Идеальное состояние, редкая комплектация! В наличии!
Ограничения на регистрационные действия наложено из-за штрафа ГИБДД 5000 р.
Штраф оплачен, ограничения снимутся в течении 2-3 дней.

Спецверсия Edition 1. Единственный владелец, ПТС оригинал, реальный пробег.  Комплектация: музыкальная система Burmester, контроль полосы, вентиляция и подогрев сидений, люк, карбоновая отделка приборов, часы IWC, колёсные диски 22 диаметра AMG, решетка радиатора Panamericana и многое другое.
Для более подробной информации, пожалуйста, свяжитесь с нашими менеджерами.

Наши преимущества:
- Гарантия юридической чистоты;
- Удобное расположение: мы находимся в минуте от метро Площадь Ильича/Римская;
- Возможность проведения диагностики в Вашем сервисе;
- Возможность приобретения в кредит;
- Профессиональная предпродажная подготовка.

Возможен торг.
